import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Home from "../components/Weather";

export default (
  <Router>
    <Switch>
      <Route path="/a" exact component={Weather} />
    </Switch>
  </Router>
);
